package db.domain;import java.util.Arrays;public class MarketPlacePanicImpl implements MarketPlacePanic {	@Key	private int panicId;	private long endTime;	private int typeId;	private int cashOld;	private int cashNew;	private int couponsOld;	private int couponsNew;	private int count;	private boolean isHot;	public MarketPlacePanicImpl() {	}	public MarketPlacePanicImpl(MarketPlacePanic c) {		this.panicId = c.getPanicId();		this.endTime = c.getEndTime();		this.typeId = c.getTypeId();		this.cashOld = c.getCashOld();		this.cashNew = c.getCashNew();		this.couponsOld = c.getCouponsOld();		this.couponsNew = c.getCouponsNew();		this.count = c.getCount();		this.isHot = c.getIsHot();	}	@Override	public String tableName() {		return "market_place_panic";	}	public void setPanicId(int panicId) {		this.panicId = panicId;	}	public int getPanicId() {		return this.panicId;	}public void addPanicId(int panicId) {		this.panicId += panicId;}	public void setEndTime(long endTime) {		this.endTime = endTime;	}	public long getEndTime() {		return this.endTime;	}public void addEndTime(long endTime) {		this.endTime += endTime;}	public void setTypeId(int typeId) {		this.typeId = typeId;	}	public int getTypeId() {		return this.typeId;	}public void addTypeId(int typeId) {		this.typeId += typeId;}	public void setCashOld(int cashOld) {		this.cashOld = cashOld;	}	public int getCashOld() {		return this.cashOld;	}public void addCashOld(int cashOld) {		this.cashOld += cashOld;}	public void setCashNew(int cashNew) {		this.cashNew = cashNew;	}	public int getCashNew() {		return this.cashNew;	}public void addCashNew(int cashNew) {		this.cashNew += cashNew;}	public void setCouponsOld(int couponsOld) {		this.couponsOld = couponsOld;	}	public int getCouponsOld() {		return this.couponsOld;	}public void addCouponsOld(int couponsOld) {		this.couponsOld += couponsOld;}	public void setCouponsNew(int couponsNew) {		this.couponsNew = couponsNew;	}	public int getCouponsNew() {		return this.couponsNew;	}public void addCouponsNew(int couponsNew) {		this.couponsNew += couponsNew;}	public void setCount(int count) {		this.count = count;	}	public int getCount() {		return this.count;	}public void addCount(int count) {		this.count += count;}	public void setIsHot(boolean isHot) {		this.isHot = isHot;	}	public boolean getIsHot() {		return this.isHot;	}}